import React from 'react';
import { Link } from 'react-router-dom';


const Islands = (props) => {
  const list = props.islands.map(island => 
    <li key={island.id}> 
    <Link to={`/islands/${island.id}`}> {island.name}</Link></li>
  )

  return (
    <ul>
      {list}
    </ul>
  )
}

export default Islands;
